import React from 'react';
 import styledAnimals from './Animals.module.css'

export default class Animals extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { animals } = this.props;
    return <div>
     {animals.map(animal => (
          <div key={animal.name}>
            <h5>{animal.name}</h5>
            <img
              src={animal.image}
              alt={animal.name}
              width="300px"
            />
            <span>{animal.species}</span>
          </div>
        ))}
    </div>
  }
}
